import React from 'react'

import WeaterExtraInfo from './WeatherExtraInfo'
import WeatherTemperature from './WeatherTemperature'
import {
    SUNNY,
    FOG,
    CLOUD,
    SNOW, 
    RAIN, 
    WIND,
} from '../constants/weathers'

const WeatherData = () => (
    <div>
        <WeatherTemperature 
            temperature={20} 
            weatherState={FOG}
        />
        <WeaterExtraInfo 
            humidity={80} 
            wind={10}
        />
    </div>

)
export default WeatherData
